  let url = "http://localhost:8080/categories";
  const [category, setCategory] = useState([]);

  useEffect(() => {
    instance.get(url).then((res) => {
      setCategory(res.data);
      console.log(category);
  });
  }, []);

  return (
    <>
      <ul>
        {
          category.map((c) => <li>item</li>)
        }
      </ul>
    </>
  );
}
export default Categoryside;
